def read_niifile(niifilepath):
    try:
        img = nib.load(niifilepath)
        img_fdata = img.get_fdata()
        return img_fdata
    except:
        print('load error ... ', niifilepath)
        img_fdata = np.ones((5, 5, 5))
    return img_fdata

